export default function Pricing () {
    return (
        <>
           <div>
             <h2>Pricing Plans</h2>
             <p>With our flexible pricing plans you can use Formidable however you like</p>
           </div>
           <div>
             <h2>Basic</h2>
           </div>
        </>
    )
}
